<style>#app-container #window{background:#000000}body{line-height:inherit!important;overflow:hidden!important}#header *,#header * ::after,#header * ::before{box-sizing:initial!important}*:hover{text-decoration:none!important}*:focus{outline:none!important}*::-webkit-scrollbar-track{-webkit-box-shadow:inset 0 0 6px rgba(0,0,0,0.3);background-color:transparent}*::-webkit-scrollbar{width:6px;height:2px;background-color:transparent}*::-webkit-scrollbar-thumb{background-color:rgba(255,255,255,.2)}.menu-overlay{background:#0000000f;position:fixed;width:100%;height:100%;z-index:1}#header{display:-webkit-flex;border-bottom:1px solid #393b3f;z-index:1000;position:fixed;width:100%;background:#000!important}#header .logo{flex:1;min-width:80px}#header .logo a{display:block;text-align:center;padding:12px 10px}#header .logo img{margin-top:10px;width:85%}#header .wintabs{flex:7;overflow:auto}#header #tabs{padding:10px;white-space:nowrap}#header #tabs .item{width:112px;min-width:112px;padding:10px;border:1px solid #ffffff1f;border-radius:3px;position:relative;cursor:pointer;margin-right:10px;display:inline-block}#header #tabs .item.active,#header #tabs .item:hover{background:#ffffff26;border-top:1px solid transparent;border-right:1px solid transparent;border-left:1px solid transparent}#header #tabs .item.active{border-bottom:3px solid #abd704}#header #tabs .item button{color:#ffffff70;background:transparent;border:0;position:absolute;margin:0;padding:0;top:3;left:3}#header #tabs .item button:hover{color:#FFF}#header #tabs .icon-item{margin-right:10px;display:inline-block;background:transparent;color:#ffffff75;font-size:20px;padding:11px 15px 14px 15px;border:1px solid #ffffff1f;border-radius:3px;cursor:pointer}#header #tabs .item button .zli{font-size:14px;cursor:pointer}#header #tabs .item img{max-width:30px;float:left;margin-right:7px}#header #tabs .item .title{color:#FFF;font-weight:bold;font-size:13px}#header #tabs .item .description{color:#ffffff75;font-size:12px}#header .user-top{flex:4;margin-right:20px}#header .user-top .row{display:-webkit-flex}#header .user-top .account{flex:3;color:#ffffff82;padding:14px 10px;font-size:12px;text-align:right}#header .user-top .account:hover{cursor:pointer;opacity:.9}#header .user-top .account:hover a{color:#FFF}#header .user-top .account a{float:right;padding:10px 5px;color:#ffffff82}#header .user-top .account div{float:right}#header .user-top .account b{display:block;font-size:25px;font-family:Arial}#header .user-top .deposit{flex:2;padding:12px 10px;max-width:150px}#header .user-top .deposit .btn-deposit{color:#08b774;display:block;border:1px solid #08b774;padding:11px 15px;text-decoration:none;font-weight:500;font-size:22px;text-align:center;border-radius:3px}#header .user-top .deposit .btn-deposit:hover{color:#FFF;background:#08b774}#app-container{overflow:auto;height:calc(100% - 20px);position:fixed;width:100%;top:74px}#app-container #windows{background-repeat:no-repeat;background-position:50% 50%;background-size:250px;width:100%;height:calc(100% - 55px);position:absolute;right:0}#app-container #window iframe{border:0;position:absolute}#app-container #window.active{display:flex}#window .chart{margin-top:-1px}@media (max-width:500px){#window #rightbar{position:fixed!important;width:100%;bottom:27px}}@media (min-width:991px){#header .logo{max-width:90px}}@media (max-width:991px){.desktop-only{display:none!important}#header .logo img{padding:2px 0!important}.user-top{display:none}#mobile_accounts{display:block!important}#app-container #windows{float:none!important;width:100%}#app-container #window.active{display:block!important;width:100%;height:100%}#app-container #window .chart{height:calc(100% - 185px)}}@-webkit-keyframes window-blink{from{transform:scale(0.98)}to{transform:scale(1)}}@-moz-keyframes window-blink{from{transform:scale(0.98)}to{transform:scale(1)}}@keyframes window-blink{from{transform:scale(0.98)}to{transform:scale(1)}}#traderoom-alerts{position:fixed;bottom:10px;left:10px;max-he
